import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(props){
    super(props)
    this.state = {
      city : null,
      aqi : null,
      render : false
    }
  }

  render() {
    return (
      <div className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <form>
            City
            <input type="text" value={this.state.city} >
            </input>
          </form>
      </div>
    );
  }
}

export default App;
